subSubSection.paragraph:
Diagnosis
. This species differs from other species of the genus by the following character states: 
1
) face and clypeus separated by impression, 
2
) head narrowed behind eyes, 
3
) occipital carina complete, 
4
) shiny smooth surface of mesopleuron and deep distinct punctures, 
5
) hind tibia reddish-yellow with dark apex, 
6
) propodeum with carinae complete.
